import logo from "./logo.svg";
import "./App.css";
import { Component } from "react";

class App extends Component {
  constructor() {
    super(); /* Calls constructor of class you are extending i.e Component*/
    this.state = {
      monsters: [
        {
          name: "Linda",
        },
        {
          name: "Frank",
        },
        {
          name: "Jacky",
        },
      ],
    };
  }

  render() {
    return <div className="App">{this.state.monsters.map()}</div>;
  }
}

export default App;
